ಚಿತ್ರದಲ್ಲಿ ತೋರಿಸಿರುವ ಚಕ್ರವನ್ನು ಎರಡು ಬಾರಿ ತಿರುಗಿಸಲಾಗುತ್ತದೆ, ಆದ್ದರಿಂದ ಸೂಚಕದಿಂದ ಸೂಚಿಸಲಾದ ಸಂಖ್ಯೆಗಳು ಯಾದೃಚ್ಛಿಕವಾಗಿ ನಿರ್ಧರಿಸಲಾಗುತ್ತದೆ (ಚಕ್ರದ ಪ್ರತಿಯೊಂದು ಸಂಖ್ಯೆ ಸಮಾನವಾಗಿ ಸಂಭವನೀಯವಾಗಿರುತ್ತದೆ). ಈ ರೀತಿಯಾಗಿ ನಿರ್ಧರಿಸಲಾದ ಎರಡು ಸಂಖ್ಯೆಗಳು ದಾಖಲಿಸಲಾಗುತ್ತದೆ. ಮೊದಲ ಸಂಖ್ಯೆಯನ್ನು 4 ರಿಂದ ಭಾಗಿಸಲಾಗುತ್ತದೆ, ಇದು ಚದುರಂಗದ ಪಟ್ಟಿಯ ಕಾಲಮ್‌ಗಳನ್ನು ಗುರುತಿಸುವ 1,2,3 ಉಳಿಕೆಗಳಲ್ಲಿ ಒಂದನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ. ಎರಡನೇ ಸಂಖ್ಯೆಯನ್ನು 5 ರಿಂದ ಭಾಗಿಸಲಾಗುತ್ತದೆ, ಇದು ಚದುರಂಗದ ಪಟ್ಟಿಯ ಸಾಲುಗಳನ್ನು ಗುರುತಿಸುವ 1,2,3,4 ಉಳಿಕೆಗಳಲ್ಲಿ ಒಂದನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ. ಕೊನೆಗೆ, ಈ ಕಾಲಮ್ ಮತ್ತು ಸಾಲುಗಳು ಸೇರುವ ಚದರದಲ್ಲಿ ಒಂದು ಚದುರಂಗವನ್ನು ಇಡಲಾಗುತ್ತದೆ. ಚದುರಂಗವನ್ನು ಚದುರಂಗದ ಪಟ್ಟಿಯ ಛಾಯಾಗ್ರಸ್ತ ಚದರದಲ್ಲಿ ಇಡಲಾಗುವ ಸಾಧ್ಯತೆ ಏನು?

